import React from "react";

function Header() {
  return (
    <header className="header">
      <h1 className="title">
        <span className="title-accent">TIC</span>{" "}
        <span className="title-accent">TAC</span>{" "}
        <span className="title-main">TOE</span>
      </h1>
    </header>
  );
}

export default Header;
